	public Map inputLanguage(String strLanguage){
		Map lreturn=[:]
		String lLanguage=strLanguage.toUpperCase().trim()
		Map lLanguageList=['EN':'en','TH':'th']
		try{
			WebElement lElementToolTipButtonClose=IGNUemaHelper.getWebElementFromDataSeleniumKey(this.driver,'closeGuide-btn')
			if(lElementToolTipButtonClose){
				IGNUemaHelper.webJsClickWebElementFinalWithScroll(this.driver,lElementToolTipButtonClose)
			}
			Boolean lResult=false
			lreturn.put('Language','')
			lreturn.put('Result',lResult)
			String lLanguageItem=lLanguageList.get(lLanguage)
			if(!lLanguageItem){
				lLanguageItem=lLanguageList.get(THAKumkaInsureCarResultType.DEFAULT_LANGUAGE.toUpperCase())
			}
			String lTagButtonSelected='language-selected'
			String lLocatorButtonSelected=IGNUemaHelper.getTagDataSeleniumKey(lTagButtonSelected)
			WebElement lElementButtonSelected=IGNUemaHelper.getWebElementFromDataSeleniumKey(this.driver,lTagButtonSelected)
			if(!lElementButtonSelected){
				return lreturn
			}
			lLanguage=IGNUemaHelper.getDataSeleniumValueWebElement(this.driver,lElementButtonSelected)
			if(!lLanguageItem.equalsIgnoreCase(lLanguage)){
				String lTagButtonOption='language'
				String lLocatorButtonOption=IGNUemaHelper.getTagDataSeleniumKeyValueEqual(lTagButtonOption,lLanguageItem)
				WebElement lElementButtonOption=IGNUemaHelper.getWebElementFromDataSeleniumKeyValueEqual(this.driver,lTagButtonOption,lLanguageItem)
				if(!lElementButtonOption){
					return lreturn
				}
				IGNUemaHelper.webJsClickWebElementFinalWithScroll(this.driver,lElementButtonOption)
				IGNUemaHelper.delayThreadSecond(1)
				lLanguage=IGNUemaHelper.getDataSeleniumValueWebElement(this.driver,lElementButtonSelected)
			}
			lLanguage=lLanguage.toUpperCase().trim()
			lResult=lLanguage.length()>0
			if(lResult){
				lreturn.put('Language',lLanguage)
				lreturn.put('Result',lResult)
			}
		}catch(Exception e){
			e.printStackTrace()
			return lreturn
		}
		return lreturn
	}
