	public Map inputPlanExcess(String strPlanExcess){
		Map lreturn=[:]
		String lPlanExcess=strPlanExcess.trim()
		if(lPlanExcess.length()<=0){
			lPlanExcess=THAKumkaInsureCarResultType.DEFAULT_DESIGN_B_PLAN_EXCESS
		}
		Map lPlanTypeList=['1':'1','2+':'2','2':'3','3+':'2','3':'3']
		Map lPlanExcessListValue1=['1':'99','2':'0','4':'3000','5':'5000']
		Map lPlanExcessListValue2=['1':'99','2':'0','3':'2000']
		try{
			Boolean lResult=false
			lreturn.put('PlanExcess','')
			lreturn.put('Result',lResult)
			this.closeAskToSaveEmailForm()
			String lTagPlanType='openFilter-TypeInsurance-btn'
			String lLocatorPlanType=IGNUemaHelper.getTagDataSeleniumKey(lTagPlanType)
			WebElement lElementPlanType=IGNUemaHelper.getWebElementFromDataSeleniumKey(this.driver,lTagPlanType)
			if(!lElementPlanType){
				return lreturn
			}
			String lPlanType=IGNUemaHelper.getDataSeleniumValueWebElement(this.driver,lElementPlanType)
			if(lPlanType.length()<=0){
				return lreturn
			}
			String lPlanTypeItem=lPlanTypeList.get(lPlanType)
			if(!lPlanTypeItem){
				return lreturn
			}
			String lPlanExcessItem=''
			switch(lPlanTypeItem){
				case '1':
					lPlanExcessItem=lPlanExcessListValue1.get(lPlanExcess)
					break
				case '2':
					lPlanExcessItem=lPlanExcessListValue2.get(lPlanExcess)
					break
				default:
					lPlanExcessItem=null
					break
			}
			String lTagPlanExcess='filter-excess-selected'
			String lLocatorPlanExcess=IGNUemaHelper.getTagDataSeleniumKey(lTagPlanExcess)
			WebElement lElementPlanExcess=IGNUemaHelper.getWebElementFromDataSeleniumKey(this.driver,lTagPlanExcess)
			if(!lElementPlanExcess){
				return lreturn
			}
			lPlanExcess=''
			if(!lPlanExcessItem){
				lPlanExcess=IGNUemaHelper.getDataSeleniumValueWebElement(this.driver,lElementPlanExcess)
				if(lPlanTypeItem.equalsIgnoreCase('3')){
					lPlanExcess='N/A'
				}
			}else{
				String lPlanExcessTarget=lPlanExcessItem
				String lPlanExcessCurrent=IGNUemaHelper.getDataSeleniumValueWebElement(this.driver,lElementPlanExcess)
				String lTagPlanExcessButtonMinus='filter-excess-minus'
				String lLocatorPlanExcessButtonMinus=IGNUemaHelper.getTagDataSeleniumKey(lTagPlanExcessButtonMinus)
				WebElement lElementPlanExcessButtonMinus=IGNUemaHelper.getWebElementFromDataSeleniumKey(this.driver,lTagPlanExcessButtonMinus)
				if(!lElementPlanExcessButtonMinus){
					return lreturn
				}
				String lTagPlanExcessButtonPlus='filter-excess-plus'
				String lLocatorPlanExcessButtonPlus=IGNUemaHelper.getTagDataSeleniumKey(lTagPlanExcessButtonPlus)
				WebElement lElementPlanExcessButtonPlus=IGNUemaHelper.getWebElementFromDataSeleniumKey(this.driver,lTagPlanExcessButtonPlus)
				if(!lElementPlanExcessButtonPlus){
					return lreturn
				}
				if(lPlanExcessTarget.equalsIgnoreCase(lPlanExcessCurrent)){
					lPlanExcess=lPlanExcessCurrent
					if(lPlanExcess.equalsIgnoreCase('99')){
						lPlanExcess='All'
					}
				}else{
					for(Integer lIndex=0;lIndex<6;lIndex++){
						IGNUemaHelper.webJsClickWebElementFinalWithScroll(this.driver,lElementPlanExcessButtonPlus)
						this.waitUntilLoaded()
						lElementPlanExcess=IGNUemaHelper.getWebElementFromDataSeleniumKey(this.driver,lTagPlanExcess)
						if(!lElementPlanExcess){
							return lreturn
						}
						lPlanExcessCurrent=IGNUemaHelper.getDataSeleniumValueWebElement(this.driver,lElementPlanExcess)
						if(lPlanExcessTarget.equalsIgnoreCase(lPlanExcessCurrent)){
							lPlanExcess=lPlanExcessCurrent
							if(lPlanExcess.equalsIgnoreCase('99')){
								lPlanExcess='All'
							}
							break
						}
					}
				}
			}
			if(lPlanExcess.equalsIgnoreCase('99')){
				lPlanExcess='All'
			}
			lResult=lPlanExcess.length()>0
			if(lResult){
				lreturn.put('PlanExcess',lPlanExcess)
				lreturn.put('Result',lResult)
			}
		}catch(Exception e){
			e.printStackTrace()
			return lreturn
		}
		return lreturn
	}
