			lreturn.put('AdvanceFilterCompany2','')
			lreturn.put('Result',lResult)
			this.closeAskToSaveEmailForm()
			if((lAdvanceFilterCountNum<lAdvanceFilterCountMin)||(lAdvanceFilterCountNum>lAdvanceFilterCountMax)){
				lAdvanceFilterCountNum=lAdvanceFilterCountDefault
			}
			lAdvanceFilterCount=lAdvanceFilterCountNum.toString()
