			if(!lElementAdvanceFilterRootSelect){
				return lreturn
			}
			List<WebElement> lInsurerAdvanceFilterList=IGNUemaHelper.getChildWebElementListOfWebElement(this.driver,lElementAdvanceFilterRootSelect,'ul li span')
			if(lInsurerAdvanceFilterList){
				String lTextFind=''
				String lTextDisplayed=''
