					lTextFind=lAdvanceFilterCompany1.toLowerCase()
					lAdvanceFilterCompany1=''
					if(lTextFind.length()>0){
						lTextDisplayed=''
						for(WebElement lInsurerAdvanceFilterItem in lInsurerAdvanceFilterList){
							lTextDisplayed=IGNUemaHelper.getChildTextByWebElement(this.driver,lInsurerAdvanceFilterItem)
							lTextDisplayed=lTextDisplayed.toLowerCase().trim()
							if(lTextDisplayed.length()>0){
								if(lTextDisplayed.contains(lTextFind)){
									lAdvanceFilterCompany1=IGNUemaHelper.getChildTextByWebElement(this.driver,lInsurerAdvanceFilterItem)
									IGNUemaHelper.webJsClickWebElementFinalWithScroll(this.driver,lInsurerAdvanceFilterItem)
									break
								}
							}
						}
					}
					lTextFind=lAdvanceFilterCompany2.toLowerCase()
					lAdvanceFilterCompany2=''
					if(lTextFind.length()>0){
						lTextDisplayed=''
						for(WebElement lInsurerAdvanceFilterItem in lInsurerAdvanceFilterList){
							lTextDisplayed=IGNUemaHelper.getChildTextByWebElement(this.driver,lInsurerAdvanceFilterItem)
							lTextDisplayed=lTextDisplayed.toLowerCase().trim()
							if(lTextDisplayed.length()>0){
								if(lTextDisplayed.contains(lTextFind)){
									lAdvanceFilterCompany2=IGNUemaHelper.getChildTextByWebElement(this.driver,lInsurerAdvanceFilterItem)
									IGNUemaHelper.webJsClickWebElementFinalWithScroll(this.driver,lInsurerAdvanceFilterItem)
									break
								}
							}
						}
					}
					lIsOK=lIsOK&&(lAdvanceFilterCompany1.length()>0)&&(lAdvanceFilterCompany2.length()>0)
				}else{
					lTextFind=lAdvanceFilterCompany1.toLowerCase()
					lAdvanceFilterCompany1=''
					lAdvanceFilterCompany2=''
					if(lTextFind.length()>0){
						lTextDisplayed=''
						for(WebElement lInsurerAdvanceFilterItem in lInsurerAdvanceFilterList){
							lTextDisplayed=IGNUemaHelper.getChildTextByWebElement(this.driver,lInsurerAdvanceFilterItem)
