	public Map inputCallMeBack(String strCallMeBack,String strCallMeBackPhoneNo){
		Map lreturn=[:]
		String lCallMeBack=strCallMeBack.trim()
		if(lCallMeBack.length()<=0){
			lCallMeBack=THAKumkaInsureCarResultType.DEFAULT_DESIGN_B_CALL_ME_BACK
		}
		String lCallMeBackPhoneNo=strCallMeBackPhoneNo.trim()
		if(lCallMeBackPhoneNo.length()<=0){
			lCallMeBackPhoneNo=THAKumkaInsureCarResultType.DEFAULT_DESIGN_B_CALL_ME_BACK_PHONE_NO
		}
		try{
			Boolean lResult=false
			lreturn.put('CallMeBack','')
			lreturn.put('CallMeBackPhoneNo','')
			lreturn.put('Result',lResult)
			Boolean lIsCallMeBack=IGNUemaHelper.convertStringToBoolean(lCallMeBack)
			Map lMapCallMeBack=[:]
			lMapCallMeBack=this.inputCallMeBackTry(lCallMeBack,lCallMeBackPhoneNo)
			if(GlobalVariable.CaseNumber==1){
				if(lIsCallMeBack){
					Integer lIndexTry=0
					Boolean lIsOK=false
					for(lIndexTry=0;lIndexTry<=5;lIndexTry++){
						lMapCallMeBack=this.inputCallMeBackTry(lCallMeBack,lCallMeBackPhoneNo)
						lIsOK=lMapCallMeBack.Result
						if(lIsOK&&(lIndexTry>1)){
							break
						}
					}
				}
			}
			if(!lMapCallMeBack.Result){
				lCallMeBack=''
				lCallMeBackPhoneNo=''
			}else{
				lCallMeBack=lMapCallMeBack.CallMeBack
				lCallMeBackPhoneNo=lMapCallMeBack.CallMeBackPhoneNo
			}
			lResult=lMapCallMeBack.Result
			if(lResult){
				lreturn.put('CallMeBack',lCallMeBack)
				lreturn.put('CallMeBackPhoneNo',lCallMeBackPhoneNo)
				lreturn.put('Result',lResult)
			}
		}catch(Exception e){
			e.printStackTrace()
			return lreturn
		}
		return lreturn
	}
